<script>
import { onMounted } from 'vue'
import { gsap } from 'gsap'
import { ScrollTrigger } from 'gsap/ScrollTrigger'

export default {
  setup () {
    onMounted(() => {
      const Spring = gsap.timeline()
      ScrollTrigger.create({
        animation: Spring,
        trigger: '.scrollElement',
        start: '2% top',
        end: '15% 100%',
        scrub: 2
      })
      gsap.to('#ltree1', { rotate: 0.7, transformOrigin: 'left bottom 100%', duration: 3, ease: 'none', repeat: -1, yoyo: true })
      gsap.to('#rtree1', { rotate: -0.7, transformOrigin: 'right bottom 100%', delay: 3, duration: 3, ease: 'none', repeat: -1, yoyo: true })
      gsap.to('#ltree2', { rotate: 0.4, transformOrigin: 'left center 100%', delay: 1, duration: 5, ease: 'none', repeat: -1, yoyo: true })
      gsap.to('#rtree2', { rotate: -0.4, transformOrigin: 'right center 100%', delay: 3, duration: 5, ease: 'none', repeat: -1, yoyo: true })
      gsap.to('#ltree3', { rotate: 0.7, transformOrigin: 'left center 100%', delay: 1, duration: 7, ease: 'none', repeat: -1, yoyo: true })
      gsap.to('#rtree3', { rotate: -0.7, transformOrigin: 'right center 100%', delay: 3, duration: 7, ease: 'none', repeat: -1, yoyo: true })
      // 타임라인으로 바꾸기
    })
  }
}
